-- ----------------------------
-- Table structure for contract_infiling
-- ----------------------------
DROP TABLE IF EXISTS `contract_infiling`;
CREATE TABLE `contract_infiling`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '收入合同备案表id',
  `oversea_center` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '海外中心',
  `counterparty_unit` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '对方签约单位',
