  `contract_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '合同名称',
  `contract_type` int(11) UNSIGNED NOT NULL COMMENT '合同类型（处理/解释/油藏/服务）',
