-- ----------------------------
-- Table structure for market_bidstatistics
-- ----------------------------
DROP TABLE IF EXISTS `market_bidstatistics`;
CREATE TABLE `market_bidstatistics`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '投标id',
  `user_id` int(10) UNSIGNED NOT NULL COMMENT '用户id',
  `area` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '地区',
  `country` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '国家',
  `lessor` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '甲方',
  `project_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '项目名称',
  `invite_time` date NULL DEFAULT NULL COMMENT '邀标时间',
  `close_time` date NULL DEFAULT NULL COMMENT '闭标时间',
  `busidate_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '业务类别（多选框1处理2解释3油藏4科研5服务）',
  `tender_body` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '投标主体',
  `support` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '总部是否支持',
  `tender_method` int(11) UNSIGNED NOT NULL COMMENT '招标方式（1投标2议标）',
  `eva_dynamics` int(11) UNSIGNED NOT NULL COMMENT '评标动态（1中标2落标3废标4弃标5评标）',
  `date` date NOT NULL COMMENT '中/落/弃标时间',
  `reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '落/弃标原因',
  `amount` decimal(10, 3) UNSIGNED NULL DEFAULT NULL COMMENT '预计合同金额（万美元）',
  `workload` decimal(10, 3) UNSIGNED NULL DEFAULT NULL COMMENT '工作量',
  `univalent` decimal(10, 3) UNSIGNED NULL DEFAULT NULL COMMENT '单价',
  `prive` decimal(10, 3) UNSIGNED NULL DEFAULT NULL COMMENT '总价（万美元）',
  `integration` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '是否一体化（1是2否）',
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `Ck_event_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 113 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

